From Wikipedia:

Key &amp; Peele is an American sketch comedy television show.[4] It stars Keegan-Michael Key and Jordan Peele, both former cast members of MADtv.[5] Each episode of the show consists of several pre-taped sketches starring the two actors, introduced by Key and Peele in front of a live studio audience. The sketches cover a variety of societal topics, often with a focus on African-American culture and race relations.
Key &amp; Peele won a 2013 Peabody Award[6] and was nominated for a 2013 Writers Guild Award.[7] The show is nominated for a NAACP Image Awards for Outstanding Comedy Series.


